class Default extends Component{
    render(){
        return(
        <div className="container">
        <div className="row">
        <div className="col-10 mx-auto text-center text-title text-uppercase pt-5">
        <h1 className="display-3">888</h1>
        <h1>ERROR</h1>
        <h2>page introuvable</h2>

        </div>

        </div>
           
        </div>


        );
    }
}
export default Default;
